import styled from 'styled-components';

export const AmountText=styled.p`
  font-family: BerkeleyStd;
  font-size: 24px;
  line-height: 1.25;
  letter-spacing: 0.5px;
  color: #022737;
`;

export const Amount=styled.p`
    
`;
